import React from 'react';

const OmApp = () => {
    return(
        <div style={{ textAlign: 'center', width: '50%', color: 'white'}}>
            <h1 style={{textAlign: 'center'}}>
                MovieSelector
            </h1>
            Movie Selector er en film applikasjon som har som mål å løse en
            av de største i-lands problemene vi har i dag,<br/> nemlig hva vi skal se på i kveld. Det er en problemstilling
            som hjemsøker mange norske hjem hver dag.  Man blir overveldet av valg og gnisningene mellom forskjellige ønsker
            drar denne prosessen i en retning ingen ønsker og sløser med tid.
        </div>
    );
};
export default OmApp;
